/* Procedure structure for procedure `insert_the_day` */

/*!50003 DROP PROCEDURE IF EXISTS  `insert_the_day` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_the_day`()
BEGIN
    DECLARE X  INT;
    DECLARE date_toadd DATE;
    SET X = 1;
    SET date_toadd = '2015/01/01';
 WHILE X  <= (366*20) DO
  SET  X = X + 1;
  INSERT IGNORE INTO `d_day` (d_dayid,`thedate`) VALUES (DATE_FORMAT(date_toadd,'%Y%m%d'),date_toadd);
  SET date_toadd=ADDDATE(date_toadd,1);
 END WHILE;
 UPDATE `d_day` SET `theday`=DAYNAME(thedate),`themonth`=MONTHNAME(thedate),`theyear`=YEAR(thedate) 
  ,`dayofmonth`=DAYOFMONTH(thedate) ,`weekofyear`=WEEKOFYEAR(thedate) , `monthofyear`=MONTH(thedate) 
  ,`quarter`=CONCAT('Q',QUARTER(thedate)) ,`fiscalperiod`=NULL ,`dayofweek`=DAYOFWEEK(thedate)
  ,`dayofyear`=DAYOFYEAR(thedate),
  otherid=DATE_FORMAT(thedate,'%y%m%d'),
  YEARWEEK=YEARWEEK(thedate,1),
  isworkingday=IFNULL(isworkingday,IF(DAYOFWEEK(thedate) IN (1,7),0,1))  
  WHERE theday IS NULL;
END */$$
DELIMITER ;

